array = ['2','3','4','5','6','7','8','9'] * 1000


def timer(funct):
    def wrapper(*args, **kwargs):
        from time import time
        start = time()
        funct(*args, **kwargs)
        print(f'{funct.__name__} ran in {time() - start} seconds')
    return wrapper


@timer
def larger(arr):
    for i in range(len(arr)):
        for j in range(len(arr)):
            # print(i, j, arr)
            if arr[j]+arr[i]>arr[i]+arr[j]:
                arr[i],arr[j]=arr[j],arr[i]
    return arr


@timer
def larger2(arr):
    for i in range(len(arr)):
        for j in range(i, len(arr)):
            # print(i, j, arr)
            if arr[j]+arr[i]>arr[i]+arr[j]:
                arr[i],arr[j]=arr[j],arr[i]
    return arr


@timer
def larger3(arr):
    for i in range(len(arr)):
        for j in range(i + 1, len(arr)):
            # print(i, j, arr)
            if arr[j]+arr[i]>arr[i]+arr[j]:
                arr[i],arr[j]=arr[j],arr[i]
    return arr


larger([str(_) for _ in array])
for _ in range(6):
    larger([str(_) for _ in array])
    larger(array)
    larger2([str(_) for _ in array])
    larger2(array)
    larger3([str(_) for _ in array])
    larger3(array)


class Solution:
    def __init__(self):
        self.visited = []
        self.count = 0
        self.notsubisland = False

    def countSubIslands(self, grid1: list[list[int]], grid2: list[list[int]]) -> int:
        row, col = len(grid1), len(grid1[0])
        print(row, 'x', col)

        def map_island(rr, cc):
            if not(0 <= rr < row and 0 <= cc < col) or grid2[rr][cc] == 0 or (rr, cc) in self.visited:
                return
            if grid2[rr][cc] != grid1[rr][cc]:
                self.notsubisland = True
            self.visited.append((rr,cc))
            map_island(rr, cc - 1), map_island(rr, cc + 1), map_island(rr + 1, cc), map_island(rr - 1, cc)
            
        import time
        start = time.time()
        for r in range(row):
            for c in range(col):
                if grid2[r][c] == 1 and (r, c) not in self.visited:
                    map_island(r, c)
                    if not self.notsubisland:
                        self.count += 1
                    self.notsubisland = False
        print(time.time() - start)
        return self.count
    

